INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES ("2030/01/01 14:59:59", 100, 1, 3001100, 0.0, "2024/10/31 12:00:00", 3001, "ヤマト", -416.5, 130011, 2.1, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 2);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES ("2030/01/01 14:59:59", 101, 4, 3001101, 0.0, "2024/10/31 12:00:00", 3001, "ヤマト", -416.5, 130011, 5.68, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 2);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES ("2030/01/01 14:59:59", 102, 1, 3001102, 0.0, "2024/10/31 12:00:00", 3001, "ヤマト", -416.5, 130011, 0.0, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 1);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES ("2030/01/01 14:59:59", 100, 1, 3002100, 0.0, "2024/10/31 12:00:00", 3002, "フブキ", -416.5, 130211, 0.0, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 1);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES ("2030/01/01 14:59:59", 101, 1, 3002101, 0.0, "2024/10/31 12:00:00", 3002, "フブキ", -416.5, 130211, 0.0, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 1);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES ("2030/01/01 14:59:59", 102, 5, 3002102, 0.0, "2024/10/31 12:00:00", 3002, "フブキ", -416.5, 130211, 8.53, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 2);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES ("2030/01/01 14:59:59", 103, 7, 3002103, 0.0, "2024/10/31 12:00:00", 3002, "フブキ", -416.5, 130211, 5.67, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 1);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES ("2030/01/01 14:59:59", 104, 1, 3002104, 0.0, "2024/10/31 12:00:00", 3002, "フブキ", -416.5, 130211, 0.0, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 1);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES ("2030/01/01 14:59:59", 300, 3, 3002300, 0.0, "2024/10/31 12:00:00", 3004, "フブキ", -416.5, 130211, 0.0, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 3);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES ("2030/01/01 14:59:59", 301, 7, 3002400, 0.0, "2024/10/31 12:00:00", 3005, "フブキ", -416.5, 130211, 0.0, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 7);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES ("2030/01/01 14:59:59", 200, 2, 3003200, 0.0, "2024/10/31 12:00:00", 3003, "フブキ", -416.5, 130211, 4.4, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 1);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES ("2030/01/01 14:59:59", 201, 7, 3003201, 0.0, "2024/10/31 12:00:00", 3003, "フブキ", -416.5, 130211, 0.0, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 7);
